import React from 'react';
import { 
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import { 
  Budget, 
  Inventory, 
  Reports, 
  Recipes, 
  Orders, 
  Tasks,
  Dashboard
} from './pages';

const App = () => {
  return (
    <div>
      <Router>
        <Switch>
          <Route exact path='/'>
            <Dashboard />
          </Route>
          <Route path='/inventory'>
            <Inventory />
          </Route>
          <Route path='/budget'>
            <Budget />
          </Route>
        </Switch>
      </Router>
    </div>
  )
}

export default App;
